import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <h2 className="navbar-logo">DevsOnDeck</h2>
      <div className="navbar-links">
        <Link to="/">Home</Link>
        <Link to="/login">Login</Link>
        <Link to="/signup-developer">Developer SignUp</Link>
        <Link to="/signup-organization">Organization SignUp</Link>
      </div>
    </nav>
  );
}

export default Navbar;
